	(1701,'en_US',851,'Workflow automation is the process of using rule-based logic to launch a series of tasks that run on their own without any human intervention. Automated workflows can send emails, schedule tasks, trigger drip campaigns, and more — all without anyone in your team touching a single button.','admin','admin','2022-11-26 00:44:48','2023-06-23 19:58:35'),
	(1702,'zh_CN',851,'决策自动化可使用业务规则从决策过程中除去手动工作，提高了业务敏捷性并降低了对 IT 的依赖程度。','admin','admin','2022-11-26 00:44:48','2023-06-23 19:58:35'),
	(1703,'en_US',852,'The data flow function allows enterprises to synchronize data and perform functions for various applications such as Sanfang application systems, enterprise internal systems, and simplified cloud algorithm models without code development.','admin','admin','2022-11-26 00:44:49','2023-06-23 19:58:35'),
	(1704,'zh_CN',852,'数据流程功能可以让企业无需代码开发就可以对各种对三房应用系统，企业内部系统，集简云算法模型等应用进行数据同步与功能执行。','admin','admin','2022-11-26 00:44:49','2023-06-23 19:58:35'),
